if mibBuilder.loadTexts: hh3cMirroringGroupMirrorInboundIfIndexList.setDescription("Inbound-Mirror ifIndex(for port) and slot number(for board) list. Example A describes the relation between values of hh3cMirroringGroupMirrorInboundIfIndexList and hh3cMirroringGroupMirrorInTypeList. Example A: hh3cMirroringGroupMirrorInboundIfIndexList: '00000002 0C000022 00000007' hh3cMirroringGroupMirrorInTypeList: '00000002 00000001 00000002' Every four octets represent an integer value. The first four octets of them should be same. Here the value '00000002' indicates there are two inbound mirror sources. The following every four octets of hh3cMirroringGroupMirrorInboundIfIndexList indicate an ifIndex or a slot number of mirror source. For '0C000022' and '00000007' in the value of hh3cMirroringGroupMirrorInboundIfIndexList above, the corresponding value of hh3cMirroringGroupMirrorInTypeList is '00000001' and '00000002'(00000001 means the mirror source is port, 00000002 means the mirror source is board, the meaning reference the object Hh3cMirrorOrMonitorType), then '0C000022' indicates an ifIndex value 201326626(decimal), and '00000007' indicates a slot with number 7(decimal). Values with different types(port/board) should be set in separate set operations. If one value with port type and one value with board type are set with same hh3cMirroringGroupID separately, the result of get operation for that entry will be like the example A above. If hh3cMirroringGroupMirrorInTypeList is not supported, the first four octets of hh3cMirroringGroupMirrorInboundIfIndexList also indicates the number of mirror source, but the following octets are values for ifIndex(port type). hh3cMirroringGroupMirrorOutboundIfIndexList and hh3cMirroringGroupMirrorOutTypeList are a pair and have the same relations like hh3cMirroringGroupMirrorInboundIfIndexList and hh3cMirroringGroupMirrorInTypeList pair. ")
